üçåü•ëü•úüå∞

Apologies for the cheeky title but this recipe makes your tastebuds go nuts! Plus, it is packed with protein, healthy fats and keeps you full for longer. Added bonus - it‚Äôs BABY FRIENDLY. 

INGREDIENTS
- Two bananas 
- One avocado 
- 1 Tbsp peanut butter 
- 1 Tbsp mixed nut and seed butter (I used @eatnuttzo from @costco)
- 1 or 2 Tbsp unsweetened cocoa powder (optional if making this for babies)
- 1/4 cup of plant based milk (I used unsweetened oat milk) 

RECIPE
Add all the above ingredients to a blender and blend until you get a smooth consistency. You can adjust the consistency by adding a dash of oat or any other milk of your choice (I add more milk to mine if I want to take it to-go). But if you want to have it as a breakfast bowl, keep it slightly on the thicker side. 

TOPPINGS 
- You can any fruits/ granola of your choice. I added blueberries, flax seed, chia and hemp seed to mine. Make sure to mash the blueberries if making this for babies or if using anything other fruit, cut them to bite sized pieces to make sure it is safe for baby to bite into.

